SELECT CAST(EXTRACT(MONTH FROM "Generico_4"."FECHA") AS BIGINT) AS "mn:FECHA:ok" FROM "Generico_4" WHERE (("Generico_4"."Anunciante" IN ('BANTRAB/TODOTICKET', 'TODOTICKET', 'TODOTICKET.COM')) AND (CAST(EXTRACT(YEAR FROM "Generico_4"."FECHA") AS BIGINT) >= 2010) AND (CAST(EXTRACT(YEAR FROM "Generico_4"."FECHA") AS BIGINT) <= 2015)) GROUP BY "mn:FECHA:ok" ORDER BY "mn:FECHA:ok" ASC ;
